        </li>
        <li className="nav-item">
        <a className="nav-link active" href="/review">Reviews</a>
        </li>
    </ul>
        <div >
        <button className="btn btn-dark">Login</button>
        </div>
    </nav>
    </>
    )
}

export default Navbar;
